import React from "react";
import Card from "./emoji_card";
import emojis from "../emoji_dictionary";


function createEmoji(emj){
        return(    <Card 
            key={emj.id}
            icon={emj.emoji} 
            name={emj.name} 
            desc={emj.category}  
            code={emj.html}
            />);
}


function app(){

    return (
    <div>
    <h1>emojipedia</h1>
    
    <div emoj></div>
    {emojis.map(createEmoji)}
    


    </div>
    );
}

export default app;
